import React from "react";


function CaseSplash(props) {

  return (
    <div className="caseStudy__detail-splash">

        <div className="splashContainer">
            <img src={props.splashImage} alt="Case Study Splash Image"></img>
            {props.splash}
        </div>

    </div>
  );
}

export default CaseSplash;
